import { Link } from "react-router-dom";

const UserList = () => {
  const users = ["user1", "user2", "user3"];

  return (
    <div>
      <h2>User List</h2>
      <ul>
        {users.map((user) => (
          <li key={user}>
            <Link to={`/list/${user}`}>{user}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default UserList;
